import React, { Component } from "react";
import "./card.css";
export default class Card extends Component {
  render() {
    const { flipped, checked, id, onClick } = this.props;
    return (
      <div
        className="mainCard"
        onClick={() => this.props.onClick(this.props.id)}
      >
        {this.props.flipped || this.props.checked ? (
          <div className="front flipeFront">Card 1 Front</div>
        ) : (
          <div className="front">Card 1 Front</div>
        )}
        {this.props.flipped || this.props.checked ? (
          <div className="back flipeBack">Card 1 Back</div>
        ) : (
          <div className="back">Card 1 Back</div>
        )}{" "}
      </div>
    );
  }
}
